import React from "react";
import "../styles/Contact.css";

function Contact() {
  const contactProfiles = [
    {
      name: "GitHub",
      logo: "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/github/github-original.svg",
      link: "https://github.com/talha-xml",
    },
    {
      name: "LinkedIn",
      logo: "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/linkedin/linkedin-original.svg",
      link: "https://www.linkedin.com/in/talha-faizan-46158532a/",
    },
    {
      name: "Instagram",
      logo: "https://upload.wikimedia.org/wikipedia/commons/a/a5/Instagram_icon.png",
      link: "https://www.instagram.com/not.mtf/",
    },
  ];

  return (
    <div className="contact-page">
      <h1 className="contact-heading">Contact Me ü§ôüèª</h1>

      {/* Email */}
      <p className="contact-email">
        <strong>Email: </strong>
        <a
          href="mailto:yourname@example.com"
          target="_blank"
          rel="noopener noreferrer"
        >
          yourname@example.com
        </a>
      </p>

      {/* Section */}
      <div className="contact-section">
        <p className="contact-guide"><strong>Follow me on my other Socials and get connected</strong></p>
        <ul className="contact-list">
          {contactProfiles.map((item, index) => (
            <li key={index}>
              <img
                src={item.logo}
                alt={`${item.name} logo`}
                className="contact-logo"
              />
              <a
                href={item.link}
                target="_blank"
                rel="noopener noreferrer"
                className="contact-link"
              >
                {item.name}
              </a>
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
}

export default Contact;
